import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import Facilities from '../facilities'
// import HeroSection from '../HeroSection';
import Footer from '../Footer';
import AddressSection from '../address'

function Home() {
  return (
    <>
      <HeroSection />
      <Cards />
    
      <Facilities/>
      <AddressSection/>
      <Footer />
    </>
  );
}

export default Home;
